const productSlice = createSlice({
  name: 'products',
  initialState,
  reducers: {
    decreaseStock: (state, action) => {
		const soldProducts = action.payload;
		console.log(soldProducts)
		soldProducts.forEach((soldProduct) => {
		const productIndex = state.products.findIndex((product) => product.id === soldProduct.id);
		if (productIndex !== -1) {
			state.products[productIndex].stock -= soldProduct.quantity;
		}
		});
	  },
  },
});

export const { decreaseStock } = productSlice.actions;

export default productSlice.reducer;
